private boolean verifyLastArgumentIsString(
      NodeTraversal t, Node methodName, Node arg) {
    return verifyNotNull(t, methodName, arg) &&
        verifyOfType(t, methodName, arg, Token.STRING) &&
        verifyIsLast(t, methodName, arg);
  }

